"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Lumbar puncture (spinal tap) (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H14930870\">",
"      <span class=\"h1\">",
"       What is a lumbar puncture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A lumbar puncture, also called an &ldquo;LP,&rdquo; or a &ldquo;spinal tap,&rdquo; is a procedure doctors use to get a sample of fluid from around the spinal cord. The spinal cord is a bundle of nerves that runs from the base of the brain down the back. Both the brain and spinal cord are surrounded by fluid called &ldquo;cerebrospinal fluid.\" This fluid, also called &ldquo;CSF,&rdquo; cushions and protects the brain and spinal cord. This fluid can hold important clues about the health of the brain and spinal cord. It can show, for example, if there is infection or bleeding in the brain.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14930885\">",
"      <span class=\"h1\">",
"       Why might my doctor order an LP?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor might order an LP to check for problems that affect the brain or spinal cord. Some examples of these problems include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An infection that affects the brain or spinal cord, such as meningitis",
"       </li>",
"       <li>",
"        Bleeding in a part of your head called the &ldquo;subarachnoid space&rdquo; &ndash; This is the area between your brain and the thin layer of tissue that covers it (",
"        <a class=\"graphic graphic_figure graphicRef61435 \" href=\"mobipreview.htm?28/49/29459\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        A condition called multiple sclerosis, which causes vision problems, numbness and tingling, muscle weakness, and other problems",
"       </li>",
"       <li>",
"        Cancer that has spread to the tissues surrounding the brain or spinal cord",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors sometimes also do LPs to give certain types of medicines directly into the area surrounding the spinal cord. Examples of medicines that might be given this way include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Anesthesia (to block pain, for example during childbirth or surgery)",
"       </li>",
"       <li>",
"        Cancer-fighting medicines (called chemotherapy)",
"       </li>",
"       <li>",
"        Antibiotics",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14930929\">",
"      <span class=\"h1\">",
"       What happens during an LP?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Before having an LP, tell your doctor if you take",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      or a medicine called",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?33/2/33830?source=see_link\">",
"       warfarin",
"      </a>",
"      (brand name: Coumadin). These medicines could increase your risk of bleeding during the procedure. It&rsquo;s important for the doctor to know if you take them. He or she will also test your blood to make sure that your blood clots normally.",
"     </p>",
"     <p>",
"      To get you ready for the LP, the doctor will probably ask you to lie on your side and hug your legs, so that your back is curved in a &ldquo;C&rdquo; shape. During the procedure, it is very important that you stay very still. Tell your doctor if you are uncomfortable or do not think you can stay still in the position he or she asks you to stay in.",
"     </p>",
"     <p>",
"      After you are in the right position, the doctor will clean the area around your lower back. He or she might also give you a shot to numb your lower back. Then the doctor will gently insert a needle into your back, between two of the bones (called &ldquo;vertebrae&rdquo;) that make up the spine. The needle will go straight through your skin and the tissues that surround the spinal cord into the space that is filled with fluid. The procedure is done in the lower part of the back below the point where the spinal cord ends (",
"      <a class=\"graphic graphic_figure graphicRef87112 \" href=\"mobipreview.htm?26/13/26835\">",
"       figure 2",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      After the doing the LP, your doctor might ask you to stay lying down for a half-hour or more, before you get up.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14930963\">",
"      <span class=\"h1\">",
"       What are the downsides of having an LP?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After having an LP, people can sometimes get a bad headache. This happens because the spot where the LP needle goes in does not always close up right away. If the hole stays open, CSF can leak out. That reduces the amount of cushioning around the brain, causing a headache.",
"     </p>",
"     <p>",
"      In most cases, the hole closes up on its own and the headache goes away in 1 to 2 days. If you get a headache after having an LP, you can take pain medicines to deal with it. The headache will also probably feel much better if you lie down. If your headache does not get better after 1 or 2 days, your doctors can offer you a treatment called a &ldquo;blood patch.&rdquo; This involves taking a small amount of blood and injecting it into the area where the LP was taken. The blood fills in the hole and CSF levels go back to normal, so the headache goes away.",
"     </p>",
"     <p>",
"      Rare problems caused by LP can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Infection",
"       </li>",
"       <li>",
"        Bleeding",
"       </li>",
"       <li>",
"        A life-threatening problem with the brain called &ldquo;cerebral herniation&rdquo; &ndash; This problem is very rare and usually happens only to people who already have a life-threatening brain condition.",
"       </li>",
"       <li>",
"        Pain or numbness in the back or legs",
"       </li>",
"       <li>",
"        Abnormal growths (called &ldquo;epidermoid tumors&rdquo;) that form on the spine long after the LP is done &ndash; These is more likely to happen in children than adults.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14930980\">",
"      <span class=\"h1\">",
"       What if my child needs an LP?",
"      </span>",
"      &nbsp;&mdash;&nbsp;LPs in children are very similar to LPs in adults, but children often must be given medicines to make them go to sleep before they have an LP. That&rsquo;s because children usually can&rsquo;t stay still the way they need to for an LP to be done the right way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14930995\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
