"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?1/48/1796?source=see_link\">",
"       Patient information: Meningitis in children (Beyond the Basics)",
"      </a>",
"     </p>",
