"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F54615&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
