var title_f43_23_44412="Surg vs nonsurg Rx LBP";
var content_f43_23_44412=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F63348&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F63348&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Surgery for chronic low back pain (excluding spinal stenosis)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Intervention",
"       </td>",
"       <td class=\"subtitle1\">",
"        Population",
"       </td>",
"       <td class=\"subtitle1\">",
"        Net benefit*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Graded recommendation&sect;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Interbody fusion",
"       </td>",
"       <td>",
"        Non-specific low back pain or degenerative disc disease with presumed discogenic low back pain",
"       </td>",
"       <td>",
"        Moderate versus standard physical therapy supplemented by other non-surgical therapies, no benefit versus intensive rehabilitation",
"       </td>",
"       <td>",
"        Suggested (for highly selected patient population)",
"        <strong>",
"         (2B)",
"        </strong>",
"       </td>",
"       <td>",
"        Inconsistency between trials may be related to use of different comparator interventions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Artificial disc replacement",
"       </td>",
"       <td>",
"        Non-specific low back pain or degenerative disc disease with presumed discogenic low back pain",
"       </td>",
"       <td>",
"        No evidence",
"       </td>",
"       <td>",
"        Suggest not performing",
"        <strong>",
"         (2C)",
"        </strong>",
"       </td>",
"       <td>",
"        One trial found Charite artificial disc non-inferior to fusion and one trial found Prodisc-L artificial disc superior to fusion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Standard open discectomy or microdiscectomy",
"       </td>",
"       <td>",
"        Lumbar disc prolapse with radiculopathy",
"       </td>",
"       <td>",
"        Moderate",
"       </td>",
"       <td>",
"        Suggested",
"        <strong>",
"         (2B)",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         In largest trial, 40 to 55 percent crossover in both arms; on-treatment analysis consistent with other trials.",
"        </p>",
"        <p>",
"         Benefits associated with surgery attenuated with longer-term follow-up.",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Based on evidence showing medication is more effective than placebo, and/or evidence showing medication is at least as effective as other medications or interventions thought to be effective, for one or more of the following outcomes: pain, functional status, or work status. Versus placebo, small benefit defined as 5-10 points on a 100-point Visual Analogue Scale (VAS) for pain (or equivalent), 1-2 points on the Roland Morris Disability Questionnaire (RDQ), 10-20 points on the Oswestry Disability Index (ODI), or a standardized mean difference (SMD) of 0.2-0.5. Moderate benefit defined as 10-20 points on a VAS for pain, 2-5 points on the RDQ, 10-20 points on the ODI, or a SMD of 0.5-0.8. Large benefit defined as &gt;20 points on a 100 point VAS for pain; &gt;5 points on the RDQ, &gt;20 points on the ODI, or a SMD of &gt;0.8.",
"     <br>",
"      &sect; Grading:",
"      <br>",
"       <strong>",
"        1A",
"       </strong>",
"       - Strong recommendation. High quality evidence. Strong recommendation, can apply to most patients in most circumstances without reservation.",
"       <br>",
"        <strong>",
"         1B",
"        </strong>",
"        - Strong recommendation. Moderate quality evidence. Strong recommendation, likely to apply to most patients.",
"        <br>",
"         <strong>",
"          1C",
"         </strong>",
"         - Strong recommendation. Low quality evidence. Relatively strong recommendation; might change when higher quality evidence becomes available.",
"         <br>",
"          <strong>",
"           2A",
"          </strong>",
"          - Weak recommendation. High quality evidence. Weak recommendation, best action may differ depending on circumstances or patients or societal values.",
"          <br>",
"           <strong>",
"            2B",
"           </strong>",
"           - Weak recommendation. Moderate quality evidence. Weak recommendation, alternative approaches likely to be better for some patients under some circumstances.",
"           <br>",
"            <strong>",
"             2C",
"            </strong>",
"            - Weak recommendation. Low quality evidence. Very weak recommendation; other alternatives may be equally reasonable.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
